import React, { Component } from 'react';

class About extends Component {
    render() {
        return (
            <div className="container">
                <h1 className="about">About Me</h1>
                <br></br><br></br>
                <h4>First off, thanks for visiting my page!</h4>
                <br></br>
                <h1><strong>I'm a college senior majoring in computer science.</strong></h1>
                <br></br>
                <h4 style={{ paddingTop: '10px' }}>I'm currently looking for internships involving <u>software and/or full stack development.</u></h4>
                <h4 style={{ paddingTop: '10px' }}>I'm also always open to new opportunities, so feel free to still contact me for unrelated roles (or if you also just want to chat).</h4>
                <br></br><br></br>
                <p>Aside from my professional interests, I'm a <strong>HUGE</strong> soccer fan (Tottenham Hotspur), I love to play video games (Starcraft II, Dead by Daylight, Valorant, 
                League of Legends), and I really enjoy swimming.
                </p>
            </div>
        );
    }
}

export default About;
